    function abrirLink(event) {
        // Verifica se é o primeiro clique

            // Define o tempo do primeiro clique

                // Reseta o tempo do primeiro clique

                setTimeout(function () {
                    document.addEventListener('mousedown', abrirLink);

            }, 10000);
        }

        // Previne o comportamento padrão do clique
        event.preventDefault();
